def normalize(x):
    stroka=re.sub(r'[\000-\377]*', lambda m:''.join([chr(ord(i)) for i in m.group(0)]).decode('utf8'),x)
    return stroka
def unHTML(x):
    s=re.sub(r'\<[^>]*\>', '',x)
    return s
